import React, { Component } from 'react'


import axios from 'axios'

import * as API_PATHS from '../api_path.js'
const API_PATH = API_PATHS.API_PATH

class Home extends Component {

  state = {
    restaurants:[],
  }

  fetchRestaurants = () => {
    axios.get(`${API_PATH}api/Restaurants`)
  }

  render() {
    return (
      <div>Home Page

      <p> RESTAURANT LIST</p>

      </div>
    )
  }
}

export default Home
